import React from "react";
import { Carousel } from "react-bootstrap";
import { Link } from 'react-router-dom';
import forest from '../image1.jpg' 

export function Slider() {
  return(
   <Carousel>
    <Carousel.Item>
      <img
      className="d-block w-50"
      src={forest}
      alt="First slide"
      />
      <Carousel.Caption>
        <h3>First slide</h3>
        <p>This is first slide^^</p>
      </Carousel.Caption>
    </Carousel.Item>

   </Carousel>
  );
}
